.\n","\n","**generosity:** Cömertlik düzeyini gösteren bir endeks.\n","\n","**income_class:** Ülkelerin gelir sınıflandırmasını gösterir (örn. düşük gelir, orta gelir vs.).\n","\n","**cpi:** Yolsuzluk Algı Endeksi."]},{"cell_type":"code","execution_count":2,"id":"c7efea0b","metadata":{"execution":{"iopub.execute_input":"2023-11-10T09:22:19.594788Z","iopub.status.busy":"2023-11-10T09:22:19.555242Z","iopub.status.idle":"2023-11-10T09:22:19.614991Z","shell.execute_reply":"2023-11-10T09:22:19.613103Z"},"papermill":{"duration":0.069886,"end_time":"2023-11-10T09:22:19.617647","exception":false,"start_time":"2023-11-10T09:22:19.547761","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["212"],"text/latex":["212"],"text/markdown":["212"],"text/plain":["[1] 212"]},"metadata":{},"output_type":"display_data"}],"source":["# Veri setinde eksik verilerin kontrol edilmesi\n","missing_values_train <- sum(is.na(world_data))\n","missing_values_train"]},{"cell_type":"markdown","id":"fb782a75","metadata":{"papermill":{"duration":0.005399,"end_time":"2023-11-10T09:22:19.62852","exception":false,"start_time":"2023-11-10T09:22:19.623121","status":"completed"},"tags":[]},"source":["# Veri setindeki eksik değerlerin doldurulması"]},{"cell_type":"code","execution_count":3,"id":"6db7fe9f","metadata":{"execution":{"iopub.execute_input":"2023-11-10T09:22:19.643647Z","iopub.status.busy":"2023-11-10T09:22:19.641728Z","iopub.status.idle":"2023-11-10T09:22:19.678018Z","shell.execute_reply":"2023-11-10T09:22:19.67603Z"},"papermill":{"duration":0.046764,"end_time":"2023-11-10T09:22:19.680748","exception":false,"start_time":"2023-11-10T09:22:19.633984","status":"completed"},"tags":[]},"outputs":[],"source":["# Orijinal veri setinin bir kopyasının saklanması\n","original_world_data <- world_data\n","\n","# country sütununu çıkartılması\n","world_data_numeric <- world_data[, !names(world_data) %in% c(\"country\")]\n","\n","# Veri setindeki eksik değerlerin doldurulması\n","for(i in 1:ncol